import React from "react";
import Navbar from "./Navbar";

const Contact = () => {
  return (
    <div>
      <Navbar />
      <h1>Contact Us</h1>
      <p>Email: contact@velavasuperstores.com</p>
      <p>Phone: +91 98765 43210</p>
    </div>
  );
};

export default Contact;
